import type { Base64 } from "../../lib/base64.ts";
import * as AtoB from "./algorithms/atob.ts";
import * as Num from "./algorithms/num.ts";
import * as Str from "./algorithms/str.ts";

const cases = [
  {
    len: "short",
    input: "aGVsbG8=",
  },
  {
    len: "medium",
    input: "VGhlIHF1aWNrIGJyb3duIGZveCBqdW1wcyBvdmVyIHRoZSBsYXp5IGRvZw==",
  },
  {
    len: "long",
    input:
      "",
  },
  {
    len: "kusodeka",
    input:
      "",
  },
] as { len: string; input: Base64 }[];

for (const { len, input } of cases) {
  Deno.bench("AtoB", { group: len }, () => {
    AtoB.decode(input);
  });
  Deno.bench("Num", { group: len }, () => {
    Num.decode(input);
  });
  Deno.bench("Str", { group: len }, () => {
    Str.decode(input);
  });
}
